exports=async function(url,bid,cid,options){const{parseContent,trimBeforeContent}=await require("transcode/parse_content");return parseContent(url,"div#content",{clientOptions:{...(options&&options.clientOptions)},preprocess:html=>html.replace(/<p>马上记住[^<]+<span[^>]*>[^<]+<\/span>[^<]+<\/p>/,"")})};